It appears that Nebula has a 16 character limit for ROM names but some of the external drivers use ROM names &gt;16 characters. My data file used the actual ROM names from the drivers (i.e. &gt;16 characters) and in a couple of cases (mslug4 and kof2001) this meant that the internal Nebula audit showed a red marker. Technically the data file was correct and a bug in Nebula was the problem. ;) It should be noted that although the audit showed a red marker, the games still loaded though.

The other problem was because the kov2 clones are not able to share ROMs with kov2 or pgmbios. I should have checked that was the case before releasing that data files but in the end, I forgot. :roll: 

