Merging between different systems is also a matter of tastes. It\'s for clones which don\'t have the same bios of the parent. If you remove the parent/clone relationship, you will have two parent games totally unrelated, which can\'t be merged, and even shared roms will always be rebuilt to both of them. If you keep games sorted by systems, you might prefer to remove the relationship. Otherwise I think it\'s not important to choose one or another. It\'s not a problem at all, just ClrMamePro asking what you want to do in these cases, as there\'s no default behaviour.

The \"missing alternative samples\" issue: I think it happens when a game is a clone of a game with sample support, but without the corresponding \"sampleof\" definition. Since I don\'t rebuild samples with the roms, I\'m not sure of what to do, but I think that setting it to the parent is the right way, unless you have samples for it. Maybe this question should be directed to Roman (in the CMP board) for a better answer.

The 100% identical clones thing happens when a game is a clone of another game but doesn\'t have any different rom needed. This happens because the difference between the games is at hardware level, not at rom level. IIRC it\'s just a warning and you can\'t choose anything about it. If you use split sets, CMP will not create the zip for the clone. IIRC if you use unmerged sets, it will create the zip for the clone. And again, this is no problem, just how things are.

Probably the best thing you can do is choose \"hide common errors\" in the options box in the profiler. Except for the samples, all the other warnings are harmless whatever you choose, so you could as well allow CMP to choose for you and just get messages for the bad errors.

