Sometimes Microsoft\'s decision to use backslashes rather than forward ones can be a real pain!

Looking at the example data files, I can see the problem straight away. For the benefit of other readers, let\'s show an example:

[code:1:c0ebfe51d8]
	rom &#40; name 2Unlimited\\2Unlimited.info size 9206 crc 0x25912891 &#41;
[/code:1:c0ebfe51d8]

The reason that I interpret \\ as an escape character is because MAME data files can include history information and in that instance, the history is full of escape characters (e.g. \'\\n\'). Escape characters appear in other fields too (like descriptions or DIP switches) and there is no easy way to change the behavior just for ROM names.

First things first, an easy workaround is to change backslashes to forward slashes (you can script this if you get hold of a command called \'sed\' and use \'sed \"s;\\\\;/;g\" input &gt;output\'). The meaning within the data file is still the same and it should be fine in CMPro if you ever use it. Any program that uses forward slashes internally will work as if they are backslashes.

With regards loading data into a database, look at the \'delimited\' format that I provide. It generates files in a database friendly format and is what I use to load games into CAESAR. The format is not documented as such but easily determined by looking at datlib/src/drv/delimited.c (read the code under \'int save_tab_delimited(struct dat *dat)\'). This will enable you to understand the contents of each field.

Logiqx');

It\'s interesting that my \"problem\" is connected to MAME history output. The last MAME version i have used to import data into my DB (0.100u2) didn\'t include any history information in the listinfo XML. In a readme or on the MAMEdev site (don\'t remember), i read that all history support has been removed from MAME. I was not happy about this, because it means i have to build my own code to import history info into my DB, using history.dat as a source.

Do you know (or does anyone know) if the history-support is back or will be back in newer MAME versions? This question might be of importance for the design of Datutil, as well...  :wink: 

Maybe it would even be possible to extend Datutil\'s functionality to import MAME history or CatVer info, and merge it with a Datfile...');

History is gone from MAME now but it isn\'t the only thing that uses escape sequences. Also, DatLib supports every version of listinfo back to when it was invented so I don\'t wish to remove history support and say DatLib is now for MAME v0.101 upwards. Support for escape sequences support will therefore remain as it is.

With regards a feature to merge in other information such as history, mameinfo, catver, etc... I don\'t think it is worth the effort that it would take. Listinfo is not the ideal place for history information and the only reason that I supported it in the first place was for completeness (i.e. if you were to convert a data file from xml-&gt;listinfo-&gt;xml it should be identical). Anyone using data sources such as history, mameinfo, catver, etc. in their databases is best off just loading them directly.

Logiqx');

