Since I need to detect name/description duplicates in a big amount of dats at the same time, and as Datutil doesn\'t remove\'em (only reports, as 2.21), I must do a tweak. I run a batch file:

md test
for %%f in (*.dat) do datutil -X -D -s -f rc -o \"test\\%%f\" \"%%f\"

Then, copy the bat + datutil.exe itself at the newly created \"test\" folder and change to 

md test
for %%f in (*.dat) do datutil -s -f rc -o \"test\\%%f\" \"%%f\"

Voila! The dupes are gone (at the second \"test\" folder). Then I can use a folder comparison app to detect all the changes (and manually fix\'em).

Without the -s option, DatUtil doesn\'t remove anything (this is the real theme of my last posts). It\'s the expected DatUtil behavoir?

