[code:1:d9c2ce3a1a]
invadersSpace InvadersinvadersSpace Invadersinvaders.h...
invadersSpace InvadersinvadersSpace Invadersinvaders.g...
invad2ctSpace Invaders IIinvad2ctSpace Invaders IIinvad2ct.h...
invad2ctSpace Invaders IIinvad2ctSpace Invaders IIinvad2ct.g...
invadersSpace InvadersinvadersSpace Invadersinvaders.f...
invadersSpace InvadersinvadersSpace Invadersinvaders.e...
[/code:1:d9c2ce3a1a]

In the above example, there are 3 games as far as DatUtil is concerned; invaders, invad2ct and invaders. If you sort them, then it saves the 3 games in a different order; invad2ct, invaders, invaders. However, if you saved in RomCenter format, the next time it loads the datafile it will think there are two games since the invaders ROMs are now contiguous (as they should be). It sounds like you have this type of problem due to duplicate games in your data files.

The function that removes duplicate ROMs within a single game can only do it\'s job fully on RomCenter files if the ROMs in each game are contiguous and thus treated as one game (as you have discovered). If not, it considers them to be different games.

If you want to identify datafiles which have non-contiguous ROMs, the new warnings will help (just use the -t [test] option and look for duplicate names/descriptions).

I can\'t do anything to improve this situation with the current DatLib architecture and I certainly don\'t plan to change it. The RomCenter format is the only format that can exhibit this type of problem... I don\'t really like the RomCenter format for this kind of reason (it allows many potential issues and bad habits in data files, this is just one of them).

