If a value contains more than one item, brackets are used to nest items. e.g.

game (
    name pacman
    description Pacman
)

If a value contains more than one word, it requires quotes. e.g.

description \"Pacman, the maze classic from Namco\"

IIRC, description and manufacturer always use quotes but for other fields quotes are optional (depending on whether they are needed or not).

Not using quotes for multi-word values should be considered a syntax error.

