Data files are now up-to-date at logiqx.com but beware of the XOR removals if you use supplements. ;)');

The main difference is that XORs are there and you can\'t do anything else with them, just play. With the decryption tables, you can advance in the understanding of them, for example Nicola Salmoria (again IIRC) was able to recognize a pattern which made him able to enhance slightly the decryption algorithm and reduced the table size by a half (original tables were 8gb, current are 4gb). And here lies the difference. With luck, talent and time, the decryption algorithm will advance, tables will be reduced further, and some day there will be a sophisticated decryption algorithm with a small decryption table. The same thing happened with the Sega System 16 FD1094 games, what MAME has now is what is believed to be the equivalent of the decryption algorithm and the key which MAME uses is believed to be the same or really similar (for all practical purposes) than the original undumpable key in the FD1094 chips. In the same way, the current CPS2 decryption method will evolve to something which will be the equivalent to the real CPS2 algorithm and key. And that is the aim of MAME. To encourage this evolution, MAME has chosen to already use the new huge decryption tables for games which already have them.

For practical purposes this means that some XORs are not needed in MAME and they\'re substituted with huge CHDs, so beware when updating your sets. You still need the XORs for other emulators, or for the MAME variants which will still use the XORs.');
