INSERT INTO phpbb_posts_text (post_id, bbcode_uid, post_subject, post_text) VALUES('87', '6691439c8c', 'CAESAR gone PHP!', 'Wow, it has taken me almost 3 years to complete this! I started the project in November 2002 (after having the idea on holiday) and by December 2002 it was already on ice, or should I say in hypersleep? Last year in the summer I worked for a month or so on tools like DatUtil 2, etc. (a requirement for me getting game information into MySQL - well, in the manner I wished) and this year I did some more MySQL+PHP work around February time. After another long dormant period (i.e. better things to be doing than coding!), I have got back to it and actually finished it off. Miracles will never cease.
