INSERT INTO phpbb_posts_text (post_id, bbcode_uid, post_subject, post_text) VALUES('649', '487a5309ac', '', 'Ok, everyone knows that CPS2 has an encrypted program, which is decrypted while the program runs on the fly using an algorithm and a key (each game and region has a key, but newer game revisions on the same region don\'t change the key). The current XOR system is a dump of the unencrypted CPS2 programs, in other words, a hack aimed only at making the games playable. On the other hand, Charles McDonald (I think it was him) was able to dump a decryption table which contains all possible decryption values for any given value and address. This table is unique for each key. So while it is not neither the real decryption algorithm nor the decryption key, it occurs on the fly in a similar way as in the real hardware.
